// frontend/src/pages/Profile.jsx
import React, { useEffect, useState } from "react";
import axios from "axios";
import { useAuth } from "../contexts/AuthContext";
import "./Profile.css";

export default function Profile() {
  const { user, setUser } = useAuth();
  const [formData, setFormData] = useState({
    name: "",
    specialization: "",
    experience: "",
    availability: "",
    patientsServed: "",
    rating: "",
    location: "",
    contact: "",
    image: ""
  });
  const [msg, setMsg] = useState("");
  const [loading, setLoading] = useState(false);

  // Fetch doctor profile
  useEffect(() => {
    const fetchDoctor = async () => {
      try {
        const res = await axios.get(`http://localhost:5000/api/doctors/${user._id}`);
        const doc = res.data;
        setFormData({
          name: doc.name || "",
          specialization: doc.specialization || "",
          experience: doc.experience || "",
          availability: doc.availability?.join(", ") || "",
          patientsServed: doc.patientsServed || "",
          rating: doc.rating || "",
          location: doc.location || "",
          contact: doc.contact || "",
          image: doc.image || ""
        });
      } catch (err) {
        setMsg(err.response?.data?.error || "Failed to load profile");
      }
    };

    if (user?.role === "doctor") fetchDoctor();
  }, [user]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const res = await axios.put(
        `http://localhost:5000/api/doctors/${user._id}`,
        formData,
        { headers: { Authorization: `Bearer ${user.token}` } }
      );
      setMsg(res.data.message);
      setUser({ ...user, ...res.data.doctor });
    } catch (err) {
      setMsg(err.response?.data?.error || "Update failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="profile-page">
      <h2>Doctor Profile</h2>
      {msg && <p className="msg">{msg}</p>}
      <form onSubmit={handleSubmit} className="profile-form">
        <label>Name</label>
        <input name="name" value={formData.name} onChange={handleChange} />

        <label>Specialization</label>
        <input name="specialization" value={formData.specialization} onChange={handleChange} />

        <label>Experience (years)</label>
        <input name="experience" type="number" value={formData.experience} onChange={handleChange} />

        <label>Availability (comma separated)</label>
        <input name="availability" value={formData.availability} onChange={handleChange} />

        <label>Patients Served</label>
        <input name="patientsServed" type="number" value={formData.patientsServed} onChange={handleChange} />

        <label>Rating</label>
        <input name="rating" type="number" step="0.1" value={formData.rating} onChange={handleChange} />

        <label>Location</label>
        <input name="location" value={formData.location} onChange={handleChange} />

        <label>Contact</label>
        <input name="contact" value={formData.contact} onChange={handleChange} />

        <label>Image URL</label>
        <input name="image" value={formData.image} onChange={handleChange} />

        {formData.image && <img src={formData.image} alt="Doctor" width="150" />}

        <button type="submit" disabled={loading}>
          {loading ? "Updating..." : "Update Profile"}
        </button>
      </form>
    </div>
  );
}
